import React, { useState } from 'react';
import axios from 'axios';
import './Excel.css';

function App() {
  const [file, setFile] = useState(null);
  const [data, setData] = useState(null);
  const [dragActive, setDragActive] = useState(false);

  const handleFileChange = (e) => {
    const selectedFile = e.target.files?.[0];
    if (selectedFile && (selectedFile.type === 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet' || selectedFile.type === 'application/vnd.ms-excel')) {
      setFile(selectedFile);
    } else {
      alert('Please upload a valid Excel file (.xlsx or .xls)');
    }
  };

  const handleDrop = (e) => {
    e.preventDefault();
    setDragActive(false);
    const droppedFile = e.dataTransfer.files[0];
    if (droppedFile && (droppedFile.name.endsWith('.xlsx') || droppedFile.name.endsWith('.xls'))) {
      setFile(droppedFile);
    } else {
      alert('Only .xlsx or .xls files are supported');
    }
  };

  const handleDragOver = (e) => {
    e.preventDefault();
    setDragActive(true);
  };

  const handleDragLeave = () => {
    setDragActive(false);
  };

  const handleUpload = async () => {
    if (!file) {
      alert('Please upload a file first');
      return;
    }

    const formData = new FormData();
    formData.append('excel', file);

    try {
      const res = await axios.post('http://localhost:5000/upload', formData);
      setData(res.data);
    } catch (err) {
      console.error("Upload failed", err);
    }
  };

  const getCount = (category) => (data?.[category]?.length || 0);

  return (
    <div className="App">
      <nav className="navbar">
        <div className="navbar-logo">Meesho</div>
        <div className="navbar-links">
          <a href="/">Home</a>
          <a href="/">Upload</a>
          <a href="/">Dashboard</a>
        </div>
      </nav>

      <h1 className='heading'>Product Status Dashboard</h1>

      <div className="status-boxes">
        <div className="box delivered">Delivered<br /><span>{getCount("delivered")}</span></div>
        <div className="box shipped">Shipped<br /><span>{getCount("shipped")}</span></div>
        <div className="box buy">DOOR_STEP_EXCHANGED<br /><span>{getCount("DOOR_STEP_EXCHANGED")}</span></div>
        <div className="box rto">RTO<br /><span>{getCount("rto")}</span></div>
        <div className="box return">Return<br /><span>{getCount("return")}</span></div>
      </div>

      <div 
        className={`upload-section ${dragActive ? 'drag-active' : ''}`}
        onDrop={handleDrop}
        onDragOver={handleDragOver}
        onDragLeave={handleDragLeave}
      >
        <p>Drag and drop your Excel file here or</p>
        <input
        type="file"
        accept=".xlsx,.xls,application/vnd.openxmlformats-officedocument.spreadsheetml.sheet,application/vnd.ms-excel"
        onChange={handleFileChange}
      />

        {file && <p className="filename">Selected File: {file.name}</p>}
        <button onClick={handleUpload}>Upload Excel File</button>
      </div>
    </div>
  );
}

export default App;
